{"iri":"http://purl.obolibrary.org/obo/IAO_0020020","type":["class","entity"],"curie":{"type":["literal"],"value":"IAO:0020020"},"definition":[{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"An information content entity that is a collection of other information content entities that has been created to identify or annotate things in a specified domain, and where the intention of its creators is that the collection has a one-to-one correspondence with those things.","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"Code sets might include non-entities/things (e.g. missing thumbs).","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"Does not imply absence vs. presence of any taxonomy.","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"Does not imply that aggregated entities denote particulars, universals, or defined classes (a.k.a. attributive collections) or even that they denote only one of these three types of entities.","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"Each aggregated entity is often (but not necessarily) associated with a text stringvariously called a description, name, title, or labelthat helps humans reach the target of denotation.

When there is no such string, it is almost always because the entities take the form of human language words. For example, a sex or gender code set could contain MALE and FEMALE, or even M and F (by convention, we understand what these mean).","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"For National Drug Codes (NDCs) and similar code sets, there doesnt even have to be a single, fully-concretized copy somewhere (for example, for NDCs there is no centralized database or repository where they all live as one instance of concretization of code set). The code set can be distributively concretized. This seems like an unusual exception, but it also likely applies to Universal Product Codes (UPCs) and their follow on Global Trade Item Numbers (GTINs).","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"For each given domain, there can potentially exist multiple code sets. The multiplicity of code sets is partially due to the different specific purposes of those code sets.","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"Many code sets are created for a specific purpose in addition to merely identifying or annotating core ideas of a specified domain.","lang":"en"},{"type":["literal"],"datatype":"http://www.w3.org/1999/02/22-rdf-syntax-ns#langString","value":"The information content entities do not denote each other.","lang":"en"}],"definitionProperty":[{"type":["literal"],"value":"http://purl.obolibrary.org/obo/IAO_0000115"},{"type":["literal"],"value":"http://www.w3.org/2000/01/rdf-schema#comment"}],"directAncestor":["http://purl.obolibrary.org/obo/IAO_0000030","http://purl.obolibrary.org/obo/BFO_0000031","http://purl.obolibrary.org/obo/BFO_0000002","http://purl.obolibrary.org/obo/BFO_0000001"],"directParent":"http://purl.obolibrary.org/obo/IAO_0000030","hasDirectChildren":true,"hasDirectParen